def translateWordFile():
    if len(selecWordFile.wordfile) > 0:
        base = os.path.basename(selecWordFile.wordfile)
        filename = os.path.splitext(base)[0]
        filext = os.path.splitext(base)[1]
        newfilename = filename+'_(TT natijasi)'+filext
        newfilename = selecWordFile.wordfile.replace(base,newfilename)
        document = Document(selecWordFile.wordfile)
        for p in document.paragraphs:
            inline = p.runs
            for i in range(len(inline)):
                text = inline[i].text
                if translateWord.wordliteral.get() == 2:
                    newstr = toCyrill(str(text))
                if translateWord.wordliteral.get() == 1:
                    newstr = toLatin(str(text))
                text=text.replace(text,newstr)
                inline[i].text = text
        for table in document.tables:
            for row in table.rows:
                for cell in row.cells:
                    text = cell.text
                    if translateWord.wordliteral.get() == 2:
                        newstr = toCyrill(str(text))
                    if translateWord.wordliteral.get() == 1:
                        newstr = toLatin(str(text))
                    text=text.replace(text,newstr)
                    cell.text = text
        document.save(newfilename)
        messagebox.showinfo("Xabarnoma", "Fayl muvaffaqiyatli tarjima qilindi. Fayl nomi: "+filename+'_(TT natijasi)'+filext)
    else:
        messagebox.showerror("Xatolik", 'MS Excel fayli tanlanmagan. Iltimos tarjimadan oldin kerakli faylni tanlang.')
